    public int[] twoSum(int[] nums, int target) {
        int[] numsre = new int[2];
        for (int i = 0; i < nums.length; i++) {
            for (int j = i + 1; j < nums.length; j++) {
                if (nums[i] + nums[j] == target) {
                    numsre[0] = i;
                    numsre[1] = j;
                    return numsre;
                }
            }
        }
        return numsre;
    }

    ListNode addTwoNumbers(ListNode l1, ListNode l2) {
        if (l1 == null && l2 == null) {
            return null;
        } else if (l1 != null && l2 == null) {
            return l1;
        } else if (l1 == null && l2 != null) {
            return l2;
        } else {
            int v = l1.val + l2.val;
            int quot = v / 10;
            int rem = v % 10;
            ListNode listNode = new ListNode(rem);
            if (quot != 0) {
                ListNode temp = new ListNode(quot);
                l1.next = addTwoNumbers(l1.next, temp);
                listNode.next = addTwoNumbers(l1.next, l2.next);
            } else {
                listNode.next = addTwoNumbers(l1.next, l2.next);
            }
            return listNode;
        }
    }

    int lengthOfLongestSubstring(String s) {

        String max = "";
        String current = "";
        for (int i = 0; i < s.length(); i++) {
            char cc = s.charAt(i);
            current += cc;
            for (int j = i+1; j < s.length(); j++) {
                char c = s.charAt(j);
                if (!current.contains(String.valueOf(c))) {
                    current += c;
                } else {
                    current = String.valueOf(c);
                }
                if (current.length() > max.length()) {
                    max = current;
                }
            }
            if (current.length() > max.length()) {
                max = current;
            }
            current = "";
        }
        return max.length();
    }

    public int lengthOfLongestSubstring1(String s) {
        if (s == null || s.length() == 0) {
            return 0;
        }

        int len = s.length();
        int max = 0;
        Map<Character, Integer> map = new LinkedHashMap<>(256);
        for (int j = 0; j < len; j++) {
            for (int i = j; i < len; i++) {
                Character c = s.charAt(i);
                if (map.containsKey(c)) {
                    map.clear();
                    map.put(c, i);
                    break;
                } else {
                    map.put(c, i);
                }
                int size = map.size();
                if (size > max) {
                    max = size;
                }
            }
            map.clear();
        }

        return max;
    }

    public int lengthOfLongestSubstring2(String s) {
        int n =  s.length();
        int max = 0;
        Map<Character, Integer> map = new HashMap<>();
        for (int i = 0, j = 0; j < n; j++) {
            if (map.containsKey(s.charAt(j))) {
                i = Math.max(map.get(s.charAt(j)), i);
            }
            max = Math.max(max, j-i+1);
            map.put(s.charAt(j), j+1);
        }

        return max;
    }

    public double findMedianSortedArrays(int[] nums1, int[] nums2) {
        int l1 = nums1.length;
        int l2 = nums2.length;
        if (l1 + l2 <= 2) {
            double sum = 0;
            for (int i : nums1) {
                sum += i;
            }
            for (int i : nums2) {
                sum += i;
            }
            return sum / (l1 + l2);
        } else {
            int from1 = 0;
            int to1 = l1;
            int from2 = 0;
            int to2 = l2;
            if (l1 == 0) {
                from2++;
                to2--;
            } else if (l2 == 0) {
                from1++;
                to1--;
            } else {
                if (nums1[0] > nums2[0]) {
                    from2++;
                } else {
                    from1++;
                }

                if (nums1[l1-1] > nums2[l2-1]) {
                    to1--;
                } else {
                    to2--;
                }
            }
            return findMedianSortedArrays(Arrays.copyOfRange(nums1, from1, to1), Arrays.copyOfRange(nums2, from2, to2));

        }
    }

    public double findMedianSortedArrays1(int[] nums1, int[] nums2) {
        int m = nums1.length;
        int n = nums2.length;
        if (m > n) {
            int[] temp = nums1; nums1 = nums2; nums2 = temp;
            int tmp = m; m = n; n = tmp;
        }

        int iMin = 0, iMax = m, halfLen = (m + n + 1) / 2;
        while (iMin <= iMax) {
            int i = (iMin + iMax) / 2;
            int j = halfLen - 1;
            if (i < iMax && nums2[j-1] > nums1[i]) {
                iMin = iMin + 1;
            } else if (i > iMin && nums1[i-1] > nums2[j]) {
                iMax = iMax - 1;
            } else {
                int maxLeft = 0;
                if (i==0) {
                    maxLeft = nums2[j-1];
                } else if (j == 0) {
                    maxLeft = nums1[i-1];
                } else {
                    maxLeft = Math.max(nums1[i-1], nums2[j-1]);
                }

                if ((m + n) % 2 == 1) {
                    return maxLeft;
                }

                int minRight = 0;
                if (i == m) {
                    minRight = nums2[j];
                } else if (j == n) {
                    minRight = nums1[i];
                } else {
                    minRight = Math.min(nums2[j], nums1[i]);
                }

                return (maxLeft + minRight) / 2.0;
            }
        }
        return 0.0;
    }

    boolean isPalindrome(String s) {
        int len = s.length();
        if (len == 0 ) {
            return true;
        } else if (len == 1) {
            return true;
        } else {
            if (s.charAt(0) == s.charAt(len-1)) {
                return isPalindrome(s.substring(1, len-1));
            } else {
                return false;
            }
        }
    }

    boolean palindrome(String s) {
        int len = s.length();
        int mid = len / 2;
        if (len < 2) {
            return true;
        }
        for (int i = 0; i < mid; i++) {
            if (s.charAt(i) != s.charAt(len-i-1)) {
                return false;
            }
        }
        return true;
    }

    public String longestPalindrome(String s) {
        int len = s.length();
        String re = "";
        int i = 0, j = len;
        while (j > 0) {
            String temp = s.substring(i, j+i);
            if (palindrome(temp)) {
                re = temp;
                break;
            } else {
                if (i + j == len) {
                    i=0;
                    j--;
                } else {
                    i++;
                }
            }
        }
        return re;
    }

    int extendAroundCenter(String s, int left, int right) {
        int L = left;
        int R = right;
        while (L >= 0 && R < s.length() && s.charAt(L) == s.charAt(R)) {
            L--;
            R++;
        }
        return R - L - 1;
    }

    public String longestPalindrome1(String s) {
        int start = 0;
        int end = 0;
        for (int i = 0; i < s.length(); i++) {
            int l1 = extendAroundCenter(s, i, i);
            int l2 = extendAroundCenter(s, i, i+1);
            int len = Math.max(l1, l2);
            if (len > (end - start)) {
                start = i - (len -1)/2;
                end = i + len/2;
            }
        }

        return s.substring(start, end+1);
    }



